import React from 'react';
import {Chart} from 'react-google-charts'

export const data = [
    ["Task", "Hours per Day"],
    ["Work", 11],
    ["Eat", 2],
    ["Commute", 2],
    ["Watch TV", 2],
    ["Sleep", 7],
  ];

  export const options_uti = {
    title: "UTI",
  };

  export const options_enfermaria = {
    title: "Enfermaria",
  };

  export const options_total = {
    title: "Total",
  };


function leitos () {
    return(
        <div className='leitos'>
            <header><h2>PÃ¡gina de Leitos</h2></header>
            <div className='charts'>
            <Chart
            chartType="PieChart"
            data={data}
            options={options_uti}
            width={"100%"}
            height={"400px"}
            />
            <Chart
            chartType="PieChart"
            data={data}
            options={options_enfermaria}
            width={"100%"}
            height={"400px"}
            />
            <Chart
            chartType="PieChart"
            data={data}
            options={options_total}
            width={"100%"}
            height={"400px"}
            />
            </div>
        </div>
    );
}

export default leitos;
